description:
Various levels, a lot of bonuses, excellent graphics and melodious music catch you into this game for a long. Collect three or more figures of the same color into horizontal or vertical line and they will disappear. If there is a stone slab under these figures it will be destroyed. To pass to the next level you should destroy all stone slabs. Do not forget about the timer it shows how much time you have. You can play online or download free this amazing matching game.
